import React from 'react';

import ButtonBlock from './ButtonBlock';
import Button from '../../UserInterface/Buttons/Button';

function LevelBlock(props) {



    return (

        <div>

            <div>
                БУК-ВА
                <span>
                    {props.letterSelect}
                </span>
            </div>
            <div>
            {
                props.stateLetters.map((item, index) => {
                    if (index < 6) {
                            return <ButtonBlock
                                namesLettersButtons={item}
                                classname={props.stateLetters[6]}
                                numberBlock={index}
                                coin={props.coin}
                                onclick={props.onclick}
                                buttonBlockFlags={props.letterBlockFlags[index]}
                                buttonBlockCompleted={props.buttonBlockCompleted[index]}

                            />
                    }

                })
                }
                </div>
            <div>
                ПРО-ИЗ-НО-СИ  БУК-ВЫ ЧЕТ-КО  И  ПРА-ВИЛЬ-НО
            </div>
            <Button
                classname='clearButton'
                onclick={props.onclickStartAgain}
                name="ВСЁ СНА-ЧА-ЛА"
            />
        </div>
     )
}

export default LevelBlock
